// Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ authenticated }) => {
  return (
    <div>
      <nav>
        <div>
          <Link to="/">Home</Link>
        </div>
        {authenticated ? (
          <div>
            <Link to="/">Return</Link>
          </div>
        ) : (
          <div>
            <Link to="/login">Login</Link>
          </div>
        )}
      </nav>
    </div>
  );
};

export default Navbar;
